import { exampleData } from "../../Data/list";
import { monthAvarge, monthCost } from "../../Data/float";

export function CalculateMonthAvarge(){

    const dataCopie = exampleData

    dataCopie.sort(function(a, b) {
        // Vergleiche Jahr
        if (a.date.year < b.date.year) return 1;
        if (a.date.year > b.date.year) return -1;
        if (a.date.month < b.date.month) return 1;
        if (a.date.month > b.date.month) return -1;
        if (a.date.day < b.date.day) return 1;
        if (a.date.day > b.date.day) return -1;
        return 0;
      })

    for (let i = 0; i < dataCopie.length; i++) {

        if (parseInt(exampleData[i].date.year) < parseInt(new Date().getFullYear()) &&
            parseInt(exampleData[i].date.month) <= parseInt(new Date().getMonth() + 1) &&
            parseInt(exampleData[i].date.day) < parseInt(new Date().getDate())){

            console.log("Daten von vor einem Jahr gefunden. ID:" + exampleData[i].id + ", Datum:" + exampleData[i].date.day + "." + exampleData[i].date.month + "." + exampleData[i].date.year)
            break
        }

        console.log("OK")
    }
}
